import { analyzePerformance } from "../utils/analyzePerformance";

const preprocess = (pattern: string): Record<string, number> => {
	const table: Record<string, number> = {};
	const len = pattern.length;

	for (let i = 0; i < len; i++) {
		// store distance from the end for each char in pattern
		table[pattern[i]] = len - 1 - i;
	}
	// if the last char is not there add it as full pattern len
	if (table[pattern[len - 1]] === undefined) table[pattern[len - 1]] = len;

	return table;
};

const boyerMoore = (str: string, pattern: string): number => {
	const badMatchTable = preprocess(pattern);
	let offset = 0;
	const patternLastIdx = pattern.length - 1;
	const maxOffset = str.length - pattern.length;

	while (offset <= maxOffset) {
		let scanIdx = 0;
		// compare chars of pattern with chars of string starting at offset
		while (pattern[scanIdx] === str[scanIdx + offset]) {
			// if all chars of pattern match with substring starting from offset return offset
			if (scanIdx === patternLastIdx) return offset;
			scanIdx++;
		}
		const badMatchChar = str[offset + patternLastIdx];
		// if bad match char is in the table move offset based on the match
		if (badMatchTable[badMatchChar]) offset += badMatchTable[badMatchChar];
		else offset++;
	}

	return -1;
};

